import React, { Component } from 'react';
import { Navbar, NavItem, Nav } from 'react-bootstrap';
import { BrowserRouter, Switch, Route, Link } from 'react-router-dom';
import Instruction from '../components/instruction';
import Valuation from '../components/valuation';

class Navigation extends Component {
    constructor(props) {
        super(props);
        this.state = {
        };
    }


    render() {

        return (
            <BrowserRouter>
                <div>
                    <div>
                        <Navbar bg="dark" variant="dark">
                            <Navbar.Brand as={Link} to="/" >React-Bootstrap</Navbar.Brand>
                            <Nav className="mr-auto" href='/'>
                                <NavItem eventkey={1} href="/instruction">
                                    <Nav.Link as={Instruction} to="/instruction">Instruction</Nav.Link>
                                </NavItem>
                                <NavItem eventkey={1} href="/valuation">
                                    <Nav.Link as={Valuation} to="/valuation">Valuation</Nav.Link>
                                </NavItem>
                            </Nav>
                        </Navbar>
                    </div>
                    <div>
                        <Switch>
                            <Route exact path='/instruction' component={Instruction} />
                            <Route exact path='/valuation' component={Valuation} />
                        </Switch>
                    </div>
                </div>
            </BrowserRouter>)

    }
}

export default Navigation;
